import React from 'react'
import { Jumbotron } from 'react-bootstrap';
import './jumbotron.css';

function MyJumbotron() {
    


    

    return (
        <div>
        <Jumbotron className='my-jumbo'>
            <h1>Want to Kayak?</h1>
            <div className='instructions' >
                <div className='step' >
                    <img className='step-img' src='https://cdn4.iconfinder.com/data/icons/hotel-and-reservation-services-outline/64/accept_reservation-512.png' />
                </div>
                <div className='step' >Pick up</div>
                <div className='step' >drop off with kayaks</div>
                <div className='step' >Pick up & drop off</div>
            </div>
        </Jumbotron>
        </div>
    )
}

export default MyJumbotron;
